import { Button } from "@/components/ui/Button";
import { ChevronRight } from "lucide-react";
// import { WavyBackground } from "@/components/ui/Wavy";
import Link from "next/link";
import NotFoundMsg from "./not-found-msg";

export const runtime = "edge";

export default function NotFound() {
	const messages = [
		[
			"The ivy has been cut!",
			"Looks like this page got pruned. But don't worry, our main garden is still thriving!",
			"Return to the Main Garden",
		],
		[
			"Rejected by University of Waterloo ðŸ˜”",
			"Don't worry! Even if Waterloo didn't accept you, ShopIvy still loves you!",
			"Attend University of Toronto",
		],
	];
	const isWaterloo = Math.floor(messages.length * Math.random()) as 0 | 1;
	// const isWaterloo = 1;
	const message = messages[isWaterloo];
	return (
		<div className="flex flex-col min-h-[100dvh] w-full justify-center items-center bg-gradient-to-br from-green-100 to-emerald-100 p-4">
			<div className="text-center">
				<h2 className="text-6xl font-bold text-green-600 mb-4">Oops! 404</h2>
				<NotFoundMsg isWaterloo={isWaterloo}>{message[0]}</NotFoundMsg>
				{isWaterloo ? <RejectWaterloo /> : <BrokenIvy />}
				<p className="text-xl text-gray-600 mb-8">{message[1]}</p>
				<Link href="/">
					<Button className="bg-green-600 hover:bg-green-700 text-white px-8 py-3 rounded-full text-lg font-semibold transition-all duration-300 ease-in-out transform hover:scale-105">
						{message[2]}
						<ChevronRight className="ml-2 w-5 h-5" />
					</Button>
				</Link>
			</div>
		</div>
	);
}

function BrokenIvy() {
	return (
		<svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 200 200" className="w-64 h-64 mx-auto mb-8">
			<g fill="none" stroke="#16a34a" strokeWidth="4" strokeLinecap="round" strokeLinejoin="round">
				{/* Stem */}
				<path d="M100,200 Q100,150 120,100 T100,0" className="animate-draw" />

				{/* Broken branches */}
				<path d="M100,80 Q120,60 140,70" className="animate-draw" />
				<path d="M100,120 Q80,100 60,110" className="animate-draw" />
				<path d="M110,160 Q130,140 150,150" className="animate-draw" />

				{/* Leaves */}
				<path d="M140,70 Q150,65 145,55 Q140,45 130,50 Q120,55 140,70" className="animate-draw" />
				<path d="M60,110 Q50,105 45,115 Q40,125 50,130 Q60,135 60,110" className="animate-draw" />
				<path d="M150,150 Q160,145 165,155 Q170,165 160,170 Q150,175 150,150" className="animate-draw" />

				{/* Break in the stem */}
				<path d="M95,90 L105,110" className="animate-draw" strokeWidth="6" />
				<path d="M105,90 L95,110" className="animate-draw" strokeWidth="6" />
			</g>
		</svg>
	);
}

